def main_solution(list_one, list_two):
    class Node:
        def __init__(self, data, next_node=None):
            self.data = data
            self.next_node = next_node

    class SortedLinkedList:
        def __init__(self, ints):
            self.head = None
            for i in sorted(ints, reverse=True):
                self.head = Node(i, self.head)

        def __iter__(self):
            node = self.head
            while node:
                yield node.data
                node = node.next_node

        def __len__(self):
            return sum(1 for _ in self)

        def __str__(self):
            return " -> ".join([str(node) for node in self])

    sll_one = SortedLinkedList(list_one)
    sll_two = SortedLinkedList(list_two)
    merged = SortedLinkedList(list(sll_one) + list(sll_two))
    return {"merged_list": list(merged)}

